window.bookSummaryJSON = "<p><b>A deadly virus. A brilliant, young researcher. And an infected survivor who threatens to steal her heart.</b></p> <p>In a society ruled by sanctions and curfews, Dr. Meghan Forester emerges as the youngest and most promising scientist to join the fight against Makanza, the deadly virus that’s ravaged the world. Inside Compound 26, a giant government-controlled research facility, Meghan’s new job involves studying the Kazzies, the rare survivors who carry the virus and now exhibit supernatural powers. But as her work unfolds, Meghan’s horrified at the brutal and unethical practices the Kazzies are subjected to. And most surprisingly, she falls in love with one.</p> <p>Faced with growing conflict over helping the Kazzies versus following the compound’s strict policies, Meghan must choose: Obey the government’s unethical practices, or risk everything to save the only man she’s ever loved.</p> <p>If you love epic sagas, women who rise to the top to prove their place in this world, and love stories that will shatter your heart before putting it back together, The Complete Makanza Series is a must-listen! This complete audiobook collection includes all four audiobooks in the Makanza Series plus the prequel:</p> <p></p> <ul> <li>Prequel - <i>The Second Wave</i></li> <li>Book One - <i>Compound 26</i></li> <li>Book Two - <i>Reservation 1</i></li> <li>Book Three - <i>Section 12</i></li> <li>Book Four - <i>Division 5</i></li> </ul>"; 
